(2328, '6/8/2020 14:50:38', 'rismaarnd@gmail.com', 'NECC 2019 (National Economics Creative Competition)', 1202184174, 'Risma Nur Damayanti', 81319135986, NULL, 'Juara 1', 'NATIONAL ECONOMICS CREATIVE COMPETITION (NECC) 2019 merupakan kegiatan perlombaan tingkat Mahasiswa se-Indonesia dengan bidang perlombaan Debat dan Esai yang diselenggarakan oleh Economics Study Club of UIN Alauddin Makassar.', 'https://drive.google.com/drive/folders/1C293AWVWpEcS2YjdsL22lZzodR3lVQFQ', 'NECC (National Economics Creative Competition) 2019 ini mengangkat tema\n“Merumuskan Strategi dalam Mengatasi Defisit Transaksi Berjalan di\nIndonesia”. Dalam konteks ini, Dengan harapan mahasiswa mampu\nmemberikan gagasan solutif dan inovatif dari permasalahan sesuai dengan\ntema tersebut. Saya harapan nantinya semoga solusi dan gagasan tersebut tidak hanya di lakukan pada saat mengikuti kompetisi tersebut namun benear-benar mampu untuk diaktualisasikan perannya sebagai agent of change dalam memecahkan masalah-masalah bangsa yang ada, khususnya di bidang\nekonomi.', 'Rangga Ahsana', 'Evidence sudah lengkap', NULL, NULL, NULL, 2019, '2019-IV', 'IV', '2014/2015', '1202184174 - RISMA NUR DAMAYANTI', 'Fakultas Rekayasa Industri', 'S1 Sistem Informasi', 2018, 'FRI', 'Nasional', 'Kelompok', 35, '> 21 PT', 'Juara 1', 'Universitas Islam Negeri Alauddin Makassar', '2019/11/06', 'Juara 1', NULL, 'Risma Nur Damayanti', 'Sudah Lengkap', NULL, NULL, NULL, 'https://escofuinam.blogspot.com/', 7.5, 'NECC 2019 (National Economics Creative Competition)_1202184174_Risma Nur Damayanti_Juara 1'),
