(2444, '6/3/2020 9:11:39', 'harisaputr@student.telkomuniversity.ac.id', 'Universitas Indonesia Innovation Battlefield', 1301174227, 'Haris Saputra', 82297000533, NULL, 'Juara 2', 'Mengikuti dan memenangkan juara 2 Lomba Universitas Innovation Battlefield yang diselenggarakan oleh BEM Universitas Indonesia', 'https://drive.google.com/drive/folders/1LiNDDTWthCODV7C7wEpmYsAOSKXms2NR?usp=sharing', 'Pelaksanaan dan partisipasi berjalan dengan baik, kompetisi tersebut memberikan saya pengalaman baru karena pada kompetisi tersebut diberikan coaching serta dapat berkenalan dengan startup lain. Sehingga dengan mengikuti kompetisi tersebut memberikan saya banyak insight. Namun pada bagian pendanaan kami cukup kesulitan, karena dana baru akan dicairkan oleh BK jika tim kami memenangkan kompetisi tersebut. Maka pada saat itu kami mengumpulkan uang transport dan penginapan terlebih dahulu agar dapat melanjutkan mengikuti kompetisi tersebut.', 'Indra Kusumajati Susanto', 'Evidence sudah lengkap', NULL, NULL, NULL, 2019, '2019-IV', 'IV', '2014/2015', '1301174227 - HARIS SAPUTRA', 'Fakultas Teknik Informatika', 'S1 Informatika', 2017, 'FIF', 'Nasional', 'Kelompok', 10, '10-20 PT', 'Juara 2', 'BEM Universitas Indonesia', '2019/11/29', 'Juara 2', NULL, 'Haris Saputra', 'Sudah Lengkap', NULL, NULL, NULL, 'https://www.suara.com/pressrelease/2019/12/09/122227/ui-selenggarakan-universitas-indonesia-innovation-battlefield', 4.5, 'Universitas Indonesia Innovation Battlefield_1301174227_Haris Saputra_Juara 2'),
