(2568, '6/23/2020 13:55:15', 'larasnurul@student.telkomuniversity.ac.id', 'The 2019 ICPC Indonesia Ideafuse Multi-Provincial Programming Contest', 1303180074, 'Deni Saputra Hermawan', 85264515858, NULL, 'Partisipan', 'mengikuti sbg tim', 'https://drive.google.com/drive/folders/1WhPw7_WTNPdgoa7LJyv4RDeCJQV1uE-w?usp=sharing', 'Kelebihan : treatment yang cukup baik untuk peserta yang berasal dari luar daerah pelaksanaan lomba tersebut. Kami diberikan informasi penginapan, lokasi dan segala macamnya dengan baik dan benar. Masalah komunikasi juga dapat dikatan lumayan bagus, sehingga segala informasi dapat jelas\n\nKekurangan : masalah teknis lomba dan jadwal. Waktu pelaksanaan terdapat kendala sehingga terjadi pengunduran waktu, mungkin bisa dijadikan pelajaran utk lebih mempersiapkan worst case yang ada. Lalu kurangnya penyesuaian jadwal, waktu itu pelaksanaannya hari jumat dan peserta yang muslim kan harus solat jumat. Jadi mungkin bisa lebih diperhatikan lagi utk masalah tersebut\n\nTapi kembali lagi ke komunikasi yang baik dari pihak panitia sehingga semua masalah dapat di tangani dengan baik', 'Laras Nurul Fazria', 'Evidence sudah lengkap', NULL, NULL, NULL, 2019, '2019-I', 'I', '2013/2014', '1303180074 - DENI SAPUTRA HERMAWAN', 'Fakultas Teknik Informatika', 'S1 Teknologi Informasi', 2018, 'FIF', 'Nasional', 'Kelompok', 22, '> 21 PT', NULL, 'Association for Computing Machinery (ACM)', '2019/03/28', 'Partisipan', NULL, 'Deni Saputra Hermawan', 'Sudah Lengkap', NULL, NULL, NULL, 'https://www.facebook.com/Mikroski', 5, 'The 2019 ICPC Indonesia Ideafuse Multi-Provincial Programming Contest_1303180074_Deni Saputra Hermawan_Partisipan'),
