(2695, '7/22/2020 23:40:09', 'mseptiono@student.telkomuniversity.ac.id', 'COMPFEST 2019', 6702184074, 'Muhammad Septiono', 81382185547, NULL, 'Partisipan', 'Saya mengikuti kegiatan lomba COMPFEST 2019 dengan tim yang telah di bentuk oleh dosen matkul algoritma & pemrograman , karena ini pertama kalinya kelompok kami mengikuti lomba pemrograman terlebih kami baru belajar algoritma pemrograman sehingga kami hanya bisa sampai sebagai partisipan. Saya berharap untuk kedepannya bisa mengikuti lomba ini kembali sebagai juara dengan membawa nama telkom university', 'https://drive.google.com/folderview?id=1E2T0RuRBMkf44Ld9BhTwjj0Qdzxw3LI5', 'Pada kegiatan lomba COMPFEST 2019 pada masalah web nya masih terdapat kendala dalam server sehingga peserta terkadang sulit masuk ke web tersebut karena server yg penuh atau masih belum stabil dan ketika lomba berlangsung peserta ingin memasukkan jawabannya di web terkadang proses loadingnya cukup lama dan skor yang di terima terkadang tidak sesuai dengan jawaban yg telah dikirim. Saya berhapap untuk kedepannya panitia COMPFEST lebih memperhatikan permasalahan pada web COMPFEST sehingga tidak akan merugikan peserta.', 'Gadis Arimbi Puspita', 'Sudah menyerahkan evidence tapi belum lengkap', NULL, NULL, NULL, 2020, '2020-II', 'II', '2013/2014', '6702184074 - MUHAMMAD SEPTIONO', 'Fakultas Ilmu Terapan', 'D3 Teknologi Komputer', 2018, 'FIT', 'Nasional', 'Kelompok', 0, '< 10 PT', NULL, 'Universitas Indonesia', '2020/05/10', 'Partisipan', NULL, 'Muhammad Septiono', 'Sudah Lengkap', NULL, NULL, NULL, 'https://www.cs.ui.ac.id/index.php/compfest-main-event-28-29-september-2019/', 3, 'COMPFEST 2019_6702184074_Muhammad Septiono_Partisipan'),
