(3299, '3/19/2020 14:54:36', 'bacharuddin@student.telkomuniversity.ac.id', 'BRIxGoogle Hackathon', 6706180113, 'Bacharuddin Adieb Pratama', 82234380491, NULL, 'Finalis', 'BRIxGoogle Hackathon merupakan lomba tingkat nasional yang diikuti kalangan umum khususnya kalangan pelajar, perguruan tinggi, hingga pengembang perangkat lunak(software house), lomba ini memiliki tema \"Membangun Ekonomi Digital Indonesia Bersama UMKM\".', 'https://drive.google.com/open?id=1UF1nUrE-j0jVbnV83rH1zuQqTdY8b_tM', 'Evaluasi dari tim kami pada lomba BRIxGoogle Hackathon 2020 adalah kelompok kami telah berusaha semaksimal mungkin dalam pelaksanaan lomba tersebut, dengan produk ritel daring yang kami usung \"Clear\". banyaknya peserta yang berasalkan dari Software House yang mengusung produk jadi (produk yang telah dikembangkan secara matang dan telah dipakai khalayak umum) menjadi kendala utama dalam lomba yang kami ikuti.', 'Nur Azizah Harun', 'Evidence sudah lengkap', NULL, NULL, NULL, 2020, '2020-I', 'I', '2013/2014', '6706180113 - BACHARUDDIN ADIEB PRATAMA', 'Fakultas Ilmu Terapan', 'D3 Rekayasa Perangkat Lunak', 2018, 'FIT', 'Nasional', 'Kelompok', 3, '< 10 PT', NULL, 'BRI dan Google', '2020/02/10', 'Partisipan', NULL, 'Bacharuddin Adieb Pratama', 'Sudah Lengkap', NULL, NULL, NULL, 'http://www.brihackathon.com/', 3, 'BRIxGoogle Hackathon_6706180113_Bacharuddin Adieb Pratama_Finalis'),
