(3318, '8/21/2020 16:57:23', 'lorakirana06@gmail.com', 'BRIxGoogle Cloud Hackathon', 6701190053, 'Lora Kirana', 82122186644, NULL, 'Finalis', 'Baby Daily', 'https://drive.google.com/file/d/1_VyYtPOx2cwJ8gh_D13MzlfNf8dWCYx-/view?usp=sharing', 'Saya dari team Baby Daily yang mengikuti lomba BRI x Google Cloud Hackathon disurabaya alhamdulillah Top 5 . Dan waktu itu team saya terdiri dari dua orang. Bisa dibilang itu pertama kali team kami mengikuti perlombaan . Dan juga kami waktu itu masih semester 2 awal. Dari kompetisi itu banyak pengalaman yang saya dapatkan , banyak relasi , bertemu banyak orang-orang hebat diluar sana yang banyak memberikan pesan dan kesan selama kompetisi. Saling berbagi pendapat dan banyak mendapatkan ilmu yang luar biasa. Dan alhamdulillah banyak masukan-masukan lain untuk lebih mengembangkan ide dari Baby Daily. ', NULL, NULL, NULL, NULL, NULL, 2020, '2020-I', 'I', '2013/2014', '6701190053 - LORA KIRANA', 'Fakultas Ilmu Terapan', 'D3 Sistem Informasi', 2019, 'FIT', 'Nasional', 'Kelompok', 20, '10-20 PT', NULL, 'UMKM', '43876', 'Partisipan', NULL, 'Lora Kirana', NULL, 'Belum Lengkap', NULL, NULL, 'https://drive.google.com/file/d/1cTd_e2ato3uz2dzbljBID15QFLPTWeI1/view?usp=sharing', 4, 'BRIxGoogle Cloud Hackathon_6701190053_Lora Kirana_Finalis'),
